import './App.css';
import './index.js';
import './Add.js';
import {Component, React} from 'react';
import ReactMarkdown from 'react-markdown'

// function formatDate(date) {
//   const year = date.getFullYear();
//   const month = date.getMonth();
//   const day = date.getDate();
//   return `${month}/${day}/${year}`;
//   console.log("formatDate performed");
// }

// function getDate() {
//   var today = new Date();
//   var year = today.getFullYear();
//   var month = today.getMonth() + 1;
//   var day = today.getDate();
//   return `${month}/${day}/${year}`;
//   console.log("getDate performed");
// }


class App extends Component {
  render (){
    return (
    <div className = "all">
      <div className = "popup_bg" id ="popup_bg">
        <div className = "popup" id ="popup">
            <form className = "popup_form" >
                <div className = "popup_top">
                  <h2 className = "logo"> Edit Profile</h2>
                    <span className="material-icons popup_exit btn" id = "close">close</span>
                </div>
                <div className = "popup_image">
                    <img className = "popup_profileImage" alt = 'hyerin' src={'./hyerin.jpg'} />
                    <div className = "btn" id="newImage"> Choose New Image</div>
                    <div className = "btn" id="rmvImage"> Remove Image </div>
                </div>

                <div className = "popup_info">
                    <div className = "popup_name">
                        <div>Name</div>
                        <input id= "name" className = "input_info" type="text" placeholder="ex. John Doe" required/>
                    </div>
                    <div className = "popup_email">
                        <div>Email</div>
                        <input id= "email" className = "input_info" type="text" placeholder="ex. john.doe@stonybrook.edu"required/>
                    </div>
                    <div className = "popup_loca">
                        <div>Location</div>
                        <input id = "location" className = "input_info" type="text" placeholder="ex. Songdo" required />
                    </div>
                </div>

                <div className = "popup_button">
                    <button className="popup_save btn" id = "save"> Save </button>
                    <div className = "popup_logout btn" id = "logout">Logout</div>
                </div>
            </form>
        </div>
    </div>

    <div className = "col">
        <div className = "col1">
            <div className = "col1_top">
                <img className = "col1_image" id ="image" alt = 'hyerin' src={require('./hyerin.jpg').default}/> 
                <div className = "col1_title"> My notes </div>
                <span className="material-icons col1_deleteBtn btn" id = "delete">delete</span>
            </div>
            <div className = "col1_search">
                <span className="material-icons col1_searchBtn btn" id="search">search</span>
                <input className="col1_inputSearch" type="text" placeholder="Search all notes"/>
            </div>
            <div className="col1_noteList" id="noteList" ></div>
        </div>
        <div className = "col2">
            <div className = "col2_top">
                <span className="material-icons col2_undoBtn" id = "undo">arrow_back</span>
                <span className="material-icons col2_addBtn" id="add">note_add</span>
            </div>
            <div className = 'col2_note'>
                <textarea className = "col2_markdown" id = "markdown"> </textarea>
                <textarea className="col2_text" id = "text"> </textarea>
            </div>  
        </div>  
      </div>
    </div>
    )
  }
}


export default App;
